import React, { Component } from "react"
import ReactDOM from "react-dom"

export default class App extends Component() {
  constructor() {
    super()
  }

  render() {
    return (
      <div>
        <h1>Hey</h1>
      </div>
    )
  }
}

ReactDOM.render(<App />, document.querySelector("#root"))
